import React from "react";
import { useSelector } from "react-redux";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/scrollbar";
import { Mousewheel, Pagination, Scrollbar } from "swiper/modules";

const SwiperSeazons = () => {
  const tvSeazons = useSelector((state) => state.series.tvDetail.data);
  return (
    <Swiper
      direction={"horizontal"}
      slidesPerView={6}
      spaceBetween={0}
      mousewheel={true}
      modules={[Mousewheel, Pagination, Scrollbar]}
      className="mt-5 "
    >
      {tvSeazons.seasons?.map((item, index) => {
        return (
          <SwiperSlide key={index} className="p-1 border-2 flex">
            <div className="h-[70%]">
              <img
                src={`https://image.tmdb.org/t/p/original${item.poster_path}`}
                alt={item.name}
                className="h-[150px] rounded-xl"
              />
            </div>
            <div className="h-30%">{item.name}</div>
          </SwiperSlide>
        );
      })}
    </Swiper>
  );
};

export default SwiperSeazons;
